- input: "TEXT\x1CC00417063\x1C.TEXT\x1C\x1CF3XN\x1CPursuant to Advisory Opinion 2005-15,
    the West Virginia Republican Party (WVRP) is choosing to terminate the West Virginia
    Republican State Exec Committee (ID number C00081802) and transferring that committee's
    residual funds as well as its outstanding debts and obligations to the West Virginia
    Republican Party, Inc. (committee ID number C00417063).  WVRP understands that
    it still has outstanding debts and obligations to vendors and will continue to
    report such debts until they are fully extinguished.  This report reflects the
    $35712.44 debts owed by the West Virginia Republican State Exec Committee; these
    debts are now reported by the West Virginia Republican Party, Inc.  All debts
    incurred this period by the West Virginia Republican Party, Inc.(totaling $35712.44),
    you will note, are actually debts transferred from the West Virginia Republican
    State Executive Committee.   This report also reflects the transfer of the residual
    funds ($2949.58) from the West Virginia Republican State Exec Committee to the
    West Virginia Republican Party, Inc."
